			shellScript = "#!/bin/sh\n\nset -e\n\nTARGET=\"CocosMac\"\n#undefine the following line if you want to move and properly unpack the .zip files into the destination folder specified with DEST_DIR\n#SCRIPT_OPTIONS=\"MOVE_FILE\"\nDEST_DIR=~/Programming/SharedLibsMac\n\nmkdir -p ~/Programming\nmkdir -p ~/Programming/SharedLibsMac\n\nGIT_REVISION=$(git describe --always)\nif [ ! -z $GIT_REVISION ]; then\n    LIB_VERSION=\"-Tag-$GIT_REVISION\"\nelse\n    LIB_VERSION=\"-unversioned\"\nfi\n\nLIBRARY_NAME=\"lib$TARGET.a\"\nLIBRARY_OUT_NAME_RELATIVE=\"lib$TARGET${LIB_VERSION}.a\"\nLIBRARY_OUT_NAME=\"lib/$LIBRARY_OUT_NAME_RELATIVE\"\nLATEST_SDK=$(xcodebuild -showsdks | grep macosx | awk 'BEGIN{FS=\"\\t\";}{print $3}' | cut -d ' ' -f 2 | tail -n 1)\n\n# remove existing build dir\nrm -rf ${PROJECT_DIR}/build\nmkdir -p ${PROJECT_DIR}/build\n\n# remove existing include dir\nrm -rf ${PROJECT_DIR}/include\nmkdir -p ${PROJECT_DIR}/include\n\nlocal_build_root=\"${PROJECT_DIR}/build\"\nbuild_styles=\"Debug Release\"\n\n# Copy headers\ncd ${PROJECT_DIR}/include\nmkdir -p cocos2d\nmkdir -p CocosDenshion\nmkdir -p external\nmkdir -p external/kazmath\nmkdir -p external/libpng\ncd ${PROJECT_DIR}\n\nrsync -r ${PROJECT_DIR}/cocos2d/include/ ${PROJECT_DIR}/include/cocos2d/\nrsync -r ${PROJECT_DIR}/CocosDenshion/include/ ${PROJECT_DIR}/include/CocosDenshion/\nrsync -r ${PROJECT_DIR}/external/kazmath/include/kazmath/ ${PROJECT_DIR}/include/external/kazmath/\nrsync -r ${PROJECT_DIR}/external/libpng/include/ ${PROJECT_DIR}/include/external/libpng/\n# Build libraries\nfor current_style in $build_styles; do\n    LIBRARY_ARCHIVE=\"$TARGET${LIB_VERSION}-${current_style}.zip\"\n\n    if [ $current_style = \"Debug\" ]; then\n        LIBRARY_ARCHIVE=\"$TARGET-${current_style}.zip\"\n    else\n        LIBRARY_ARCHIVE=\"$TARGET.zip\"\n    fi\n\n    # remove existing output file\n    rm -rf ${PROJECT_DIR}/lib\n    mkdir -p ${PROJECT_DIR}/lib\n\n    # Build library for MacOS X\n    xcodebuild clean -target $TARGET -project cocos2d-osx.xcodeproj -configuration $current_style -sdk $LATEST_SDK\n    xcodebuild -target $TARGET -project cocos2d-osx.xcodeproj -configuration $current_style -sdk $LATEST_SDK build\n\n    # Glue together libraries\n    lipo \"${local_build_root}/${current_style}/$LIBRARY_NAME\" -create -output \"${PROJECT_DIR}/$LIBRARY_OUT_NAME\"\n\n    # Create symlink\n    cd lib\n    ln -s \"$LIBRARY_OUT_NAME_RELATIVE\" \"$LIBRARY_NAME\"\n    cd ..\n\n    #TODO: deal with either Chipmunk or Box2D\n    #unless they are not going to be packaged with this library any longer\n\n    if [ $? -eq 0 ]; then\n        zip -R -y \"${PROJECT_DIR}/$LIBRARY_ARCHIVE\" \"lib/*.a\"\n        zip -r -y \"${PROJECT_DIR}/$LIBRARY_ARCHIVE\" \"resources\" \"include\" -x@zip_exclude.lst\n        #zip \"${PROJECT_DIR}/$LIBRARY_ARCHIVE\" .packageid\n    fi\n\n    if [ $SCRIPT_OPTIONS = \"MOVE_FILE\" ]; then\n        BUILT_ZIP=\"${PROJECT_DIR}/$LIBRARY_ARCHIVE\"\n        NEW_ZIP=\"$DEST_DIR/$LIBRARY_ARCHIVE\"\n\n        if [ $current_style = \"Debug\" ]; then\n            OLD_FOLDER=\"$DEST_DIR/$TARGET-${current_style}\"\n        else\n            OLD_FOLDER=\"$DEST_DIR/$TARGET\"\n        fi\n        rm -rf $OLD_FOLDER\n        mv $BUILT_ZIP \"$DEST_DIR/\"\n        unzip -o $NEW_ZIP -d $OLD_FOLDER/\n        rm -f $NEW_ZIP\n    fi\ndone\n\nrm -rf ${PROJECT_DIR}/include\nrm -rf ${PROJECT_DIR}/build\nrm -rf ${PROJECT_DIR}/lib\n";
		};
